class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        dict_s = {}
        dict_t = {}

        for x in s:
            if x not in dict_s:
                dict_s[x] = 1
            elif x in dict_s:
                dict_s[x]+=1
        
        for x in t:
            if x not in dict_t:
                dict_t[x] = 1
            elif x in dict_t:
                dict_t[x]+=1

        
        for key, value in dict_t.items():
            if key in dict_s and dict_s[key] != dict_t[key]:
                 return key
            if key not in dict_s:
                return key
    
s = Solution()
print(s.findTheDifference("",
                          ""))
print(s.findTheDifference("abcd",
                          "abcde"))